package design.pattern.builder.inherit.domain;import lombok.Data;@Datapublic class BaseLogs {    /**     * log-token     */    private String logToken;    protected BaseLogs(Builder builder){        this.logToken = builder.logToken;    }    public static class Builder{        /**         * log-token         */        private String logToken;        public Builder LogToken(String logToken){            this.logToken = logToken;            return this;        }        public BaseLogs builder(){            return new BaseLogs(this);        }    }}